import React, {StrictMode} from "react";
import {HeaderPag, FooterPag, NavMenu} from "../../layout";

// Agregar la Navegacion que se desea en la pagina
const Navegacion = [
    {
        "id":"Informatica",
        "sub": {
            "temas": ["Uno","dos","Tres"]
        }
    },
    {
        "id":"Concepto",
        "sub": {
            "temas": ["Cuartro","dos","tres"]
        }
    }
]

export function HomePage(){
    return(
        <StrictMode>
            <HeaderPag/>
            <main>
                <section>
                    <nav>
                        <NavMenu temas={Navegacion.map(type => type)}/>
                    </nav>
                </section>


            </main>
            <FooterPag/>
        </StrictMode>
    )
}
